import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import {BrowserRouter} from 'react-router-dom';
import StartPage from "./components/StartPage";



class App extends Component {
    render() {
        return (
            <div className="App">

            <BrowserRouter>
            <StartPage/>
            </BrowserRouter>
            </div>
    );
    }
}
